"use client";

import { useState } from "react";
import MoodChart from "./MoodChart";
import Calendar from "./Calendar";
import AlarmClock from "./AlarmClock";
import ActivityGraph from "./ActivityGraph";
import Statistics from "./Statistics";
import UserProfile from "./UserProfile";
import MoodSelector from "./MoodSelector";


export default function Dashboard() {
  const [journalEntries, setJournalEntries] = useState({
    "2024-01-15": true,
    "2024-01-16": true,
    "2024-01-18": true,
    "2024-01-20": true,
    "2024-01-22": true,
  });

  const [moodData, setMoodData] = useState([
    { day: "Mon", mood: 8, color: "bg-pink-300" },
    { day: "Tue", mood: 6, color: "bg-green-300" },
    { day: "Wed", mood: 9, color: "bg-pink-400" },
    { day: "Thu", mood: 4, color: "bg-green-200" },
    { day: "Fri", mood: 7, color: "bg-pink-300" },
    { day: "Sat", mood: 9, color: "bg-green-400" },
    { day: "Sun", mood: 8, color: "bg-pink-400" },
  ]);

  return (
    <div className="min-h-screen bg-gradient-to-br from-pink-50 via-green-50 to-pink-100 p-4 relative overflow-hidden">

      {/* Header */}
      <div className="flex justify-between items-center mb-8">
        <div>
          <h1 className="text-4xl font-bold text-pink-600 mb-2">
            âœ¨ Pookie Dashboard âœ¨
          </h1>
          <p className="text-green-600 text-lg">
            Your cute daily companion ðŸŒ¸
          </p>
        </div>
        <UserProfile />
      </div>

      {/* Main Grid */}
      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6 mb-6">
        {/* Mood Chart */}
        <div className="lg:col-span-1">
          <MoodChart data={moodData} />
        </div>

        {/* Calendar */}
        <div className="lg:col-span-1">
          <Calendar
            journalEntries={journalEntries}
            setJournalEntries={setJournalEntries}
          />
        </div>

        {/* Alarm Clock */}
        <div className="lg:col-span-1">
          <AlarmClock />
        </div>
      </div>

      {/* Bottom Section */}
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
        {/* Activity Graph */}
        <div>
          <ActivityGraph />
        </div>

        {/* Statistics and Mood Selector */}
        <div className="space-y-6">
          <Statistics
            journalEntries={journalEntries}
            moodData={moodData}
          />
          <MoodSelector />
        </div>
      </div>
    </div>
  );
}
